import { SAVE_ACTIVE_WELL_TO_REDUX_STORE } from "./types"

export default (selectedWell) => {
  return dispatch => {
    dispatch({type: SAVE_ACTIVE_WELL_TO_REDUX_STORE, payload: selectedWell})
  }
}
